import React  from "react"

const Table = (props) => {
  return (
    <div>
        <table>
            <tr>
            <th># </th>
            {
                Object.keys(props.details)
                .map(values => <th> {values}</th>)
            }
            </tr>
        </table>
    </div>
)

} 

export default Table;
